import React from 'react';
import AdminGroupsEdit  from './AdminGroupsEdit';


export default class AdminGroupsButtons extends React.Component {
    //
    // constructor(props) {
    //     super(props);
    //
    //     this.state = {groups: false}
    //     this.toggleGroups = this.toggleGroups.bind(this)
    // }
    // toggleGroups() {
    //     const groups = this.state.groups
    //     // set this.state.open to true/false
    //     this.setState( {
    //         groups: !groups
    //     })
    // }
    // closeGroups = (e) => {
    //     this.props.changeHandler(e);
    // }
    loopGroups() {
        const groups = [1, 2, 3, 4, 5, 6, 7, 8];
    }

    render() {
        // console.log(this.state.groups)
        return (
            <div className={"grid xl:grid-cols-4 lg:grid-cols-3 grid-cols-2"}>

                {loopGroups.map((loopGroups, groups) => {
                    return (
                        <>
                            <div className={"py-1 px-1"}>
                                <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                                    <h4 className={"text-base"}>sd21-{groups}</h4>
                                    <div>
                                        <button>edit</button>
                                        {/*onClick={this.closeGroups}*/}
                                        {/*{this.state.groups ? <AdminGroupsEdit changeHandler={this.toggleGroups.bind(this)}/> : null}*/}
                                    </div>
                                    <a>dashboard</a>
                                    <a>issues</a>
                                    <a>agileboard</a>
                                </div>
                            </div>
                        </>
                    )})}
                <div className={"py-1 px-1"}>
                    <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                        <h4 className={"text-base"}>sd21-2</h4>
                        <div>
                            <button>edit</button>
                            {/*onClick={this.closeGroups}                */}
                        </div>
                        <a>dashboard</a>
                        <a>issues</a>
                        <a>agileboard</a>
                    </div>
                </div>
                <div className={"py-1 px-1"}>
                    <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                        <h4 className={"text-base"}>sd21-2</h4>
                        <div>
                            <button>edit</button>
                            {/*onClick={this.closeGroups}                */}
                        </div>
                        <a>dashboard</a>
                        <a>issues</a>
                        <a>agileboard</a>
                    </div>
                </div>
                <div className={"py-1 px-1"}>
                    <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                        <h4 className={"text-base"}>sd21-2</h4>
                        <div>
                            <button>edit</button>
                            {/*onClick={this.closeGroups}                */}
                        </div>
                        <a>dashboard</a>
                        <a>issues</a>
                        <a>agileboard</a>
                    </div>
                </div>
                <div className={"py-1 px-1"}>
                    <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                        <h4 className={"text-base"}>sd21-2</h4>
                        <div>
                            <button>edit</button>
                            {/*onClick={this.closeGroups}                */}
                        </div>
                        <a>dashboard</a>
                        <a>issues</a>
                        <a>agileboard</a>
                    </div>
                </div>
                <div className={"py-1 px-1"}>
                    <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                        <h4 className={"text-base"}>sd21-2</h4>
                        <div>
                            <button>edit</button>
                            {/*onClick={this.closeGroups}                */}
                        </div>
                        <a>dashboard</a>
                        <a>issues</a>
                        <a>agileboard</a>
                    </div>
                </div>
                <div className={"py-1 px-1"}>
                    <div className={"flex flex-col border border-color bg-light w-full h-full py-1 px-2 text-sm"}>
                        <h4 className={"text-base"}>sd21-2</h4>
                        <div>
                            <button>edit</button>
                            {/*onClick={this.closeGroups}                */}
                        </div>
                        <a>dashboard</a>
                        <a>issues</a>
                        <a>agileboard</a>
                    </div>
                </div>
            </div>
        )

    }
}
